import React, { useState } from "react";
import { Col, Row, Form, Input, Button, Spin, Divider } from "antd";

const Order = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(false);

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        paddingTop: "4rem",
        backgroundColor: "#eee",
      }}
    >
      <div
        style={{
          width: "100%",
          maxWidth: "850px",
          display: "flex",
          flexDirection: "column",
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            marginBottom: "2rem",
          }}
        >
          <h3>PLACE AN ORDER</h3>
        </div>

        <Row style={{ height: "100%", marginBottom: "3rem" }} gutter={16}>
          { loading ? (
            <Spin />
          ) : (
            orders.map((order) => (
              <Col
                style={{ backgroundColor: "#fff", padding: "1rem" }}
                span={12}
                offset={6}
              >
                <Form
                  //form={form}
                  layout="vertical"
                >
                  <Form.Item
                    label="Raivaussiivous osoite"
                    name="requiredMarkValue"
                    required
                  >
                    <Input placeholder="Raivaussiivous osoite" />
                  </Form.Item>
                  <Form.Item
                    label="Description/Viesti"
                    required
                    tooltip="This is a required field"
                  >
                    <Input.TextArea
                      rows={3}
                      placeholder="Huomio/ViestikenttÃ¤"
                    />
                  </Form.Item>
                  <Divider/>
                  {
                    orders.service.map((bOrder) => (
                      <><p>{bOrder.name}</p><p>{bOrder.price}</p></>
                    ))
                  }
                  <Button type="primary">Submit</Button>
                </Form>
              </Col>
            ))
          )}
        </Row>
      </div>
    </div>
  );
};

export default Order;
